                    text: "\u0414\u0430\u0432\u043d\u043e \u043c\u0435\u0447\u0442\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0432 IT \u0441\u0444\u0435\u0440\u0435, \u043d\u043e \u0432 32 \u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u0431\u0443\u0434\u0442\u043e \u0443\u0436\u0435 \u043f\u043e\u0437\u0434\u043d\u043e. \u0421\u0430\u043c\u043e\u043c\u0443 \u0431\u044b\u043b\u043e \u0441\u043b\u043e\u0436\u043d\u043e \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u044e \u0438 \u044f \u043d\u0430\u0442\u043a\u043d\u0443\u043b\u0441\u044f \u043d\u0430 \u043a\u0443\u0440\u0441 \xab\u041e\u0441\u043d\u043e\u0432\u044b \u0442\u0435\u0441\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f\xbb \u043e\u0442 IT \u0448\u043a\u043e\u043b\u044b IT Школа WinPoWer.\n        \u041e\u0447\u0435\u043d\u044c \u043f\u0440\u0438\u0432\u043b\u0435\u043a\u043b\u0430 \u0446\u0435\u043d\u0430, \u043d\u0430\u043c\u043d\u043e\u0433\u043e \u043d\u0438\u0436\u0435, \u0447\u0435\u043c \u0443 \u043a\u043e\u043d\u043a\u0443\u0440\u0435\u043d\u0442\u043e\u0432 \u0438 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043f\u043e\u043b\u0443\u0447\u0430\u0442\u044c \u043e\u0431\u0440\u0430\u0442\u043d\u0443\u044e \u0441\u0432\u044f\u0437\u044c \u043e\u0442 \u043d\u0430\u0441\u0442\u0430\u0432\u043d\u0438\u043a\u0430.\n\u0423\u0447\u0435\u0431\u0430 \u0431\u044b\u043b\u0430 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e\u0439, \u0437\u0430\u0432\u043b\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0438 \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u043e\u0431\u044a\u0435\u043c\u043d\u043e\u0439. \u041f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u0442\u0435\u043b\u044c \u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u0421\u043e\u043a\u043e\u043b\u043e\u0432 \u0432\u0441\u0435\u0433\u0434\u0430 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u043b \u043d\u0430 \u043f\u043e\u043c\u043e\u0449\u044c, \u0432 \u0441\u043b\u0443\u0447\u0430\u0435 \u0437\u0430\u0442\u0440\u0443\u0434\u043d\u0435\u043d\u0438\u0439, \u0441\u0432\u043e\u0435\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u043f\u0440\u043e\u0432\u0435\u0440\u044f\u043b \u0434\u043e\u043c\u0430\u0448\u043d\u0438\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u044f \u0438 \u0440\u0430\u0437\u0432\u0451\u0440\u043d\u0443\u0442\u043e \u043e\u0431\u044a\u044f\u0441\u043d\u044f\u043b \u043e\u0448\u0438\u0431\u043a\u0438 \u0438 \u043f\u0443\u0442\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u044f. ",
                    shortText: "\u0414\u0430\u0432\u043d\u043e \u043c\u0435\u0447\u0442\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0432 IT \u0441\u0444\u0435\u0440\u0435, \u043d\u043e \u0432 32 \u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u0431\u0443\u0434\u0442\u043e \u0443\u0436\u0435 \u043f\u043e\u0437\u0434\u043d\u043e. \u0421\u0430\u043c\u043e\u043c\u0443 \u0431\u044b\u043b\u043e \u0441\u043b\u043e\u0436\u043d\u043e \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u044e \u0438 \u044f \u043d\u0430\u0442\u043a\u043d\u0443\u043b\u0441\u044f \u043d\u0430 \u043a\u0443\u0440\u0441 \xab\u041e\u0441\u043d\u043e\u0432\u044b \u0442\u0435\u0441\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f\xbb \u043e\u0442 IT \u0448\u043a\u043e\u043b\u044b IT Школа WinPoWer. \u0423\u0447\u0435\u0431\u0430 \u0431\u044b\u043b\u0430 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e\u0439, \u0437\u0430\u0432\u043b\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0438 \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u043e\u0431\u044a\u0435\u043c\u043d\u043e\u0439.",
