                    text: "",
                    shortText: "\u041a\u0443\u0440\u0441 \u0431\u044b\u043b \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u044b\u043c, \u043e\u0431\u044a\u044f\u0441\u043d\u0435\u043d\u0438\u0435 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0430 \u0441 \u043a\u0430\u0436\u0434\u044b\u043c \u0437\u0430\u043d\u044f\u0442\u0438\u0435\u043c \u0432\u044b\u0437\u044b\u0432\u0430\u043b\u043e \u0436\u0435\u043b\u0430\u043d\u0438\u0435 \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u044e \u0434\u0430\u043b\u044c\u0448\u0435. \u041a\u0443\u0440\u0441 \u0431\u044b\u043b \u043b\u0451\u0433\u043a\u0438\u0439 \u0438 \u043d\u0435 \u0441\u043b\u043e\u0436\u043d\u044b\u0439, \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u043d\u044b\u0435 \u0437\u043d\u0430\u043d\u0438\u044f \u043f\u043e\u043c\u043e\u0433\u043b\u0438 \u043c\u043d\u0435 \u043d\u0430\u0439\u0442\u0438 \u0432 \u0442\u0440\u0443\u0434\u043e\u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0435. \u041d\u0430 \u0434\u0430\u043d\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u044f \u0438\u043d\u0436\u0435\u043d\u0435\u0440 \u043f\u043e \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u044e \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0445 \u0441\u0438\u0441\u0442\u0435\u043c \u041e\u043a\u043b\u0430\u0434\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c 40.000\u20bd",
